import React from "react";
import Table from "./Table";
import LinearProgress from "@material-ui/core/LinearProgress";

export default function MainWindow(props) {
  const title = props.title,
    items = props.items,
    likes = props.likes;


  if (items) { 
    console.log(props.favorites_teams);
    
    // props.favorites_teams.then((list)=>{console.log(list)})}

    return (
      
      <section>
        <h2>{title}</h2>
        <div className="items_list">
          {items.map((item, key) => (
              <Table
                is_like={likes}
                item={item}
                key={key}
                like={(like_data, id) => {
                  props.like(like_data, id);
                }}
              />
            ))}
        </div>
      </section>
    );
  } else {
    return <section>
      <LinearProgress className="line"/>
    </section>
  }
}
